import React, {Component, Fragment} from 'react';
import Login from "../components/Login/Login";
import TopBanner from "../components/TopBanner/TopBanner";

class PortfolioPage extends Component {
    componentDidMount() {
        window.scroll(0, 0)

    }

    render() {
        return (
            <Fragment>
                
                <TopBanner/>
                <Login/>

            </Fragment>
        );
    }
}

export default PortfolioPage;
